To simplify exception handling in Python, we can use context managers, `try-except` blocks with specific exceptions, and `finally` for cleanup. Here's an example:

```python
# Example: Simplified exception handling with context manager
def read_file_safely(file_path):
    try:
        with open(file_path, 'r') as file:
            return file.read()
    except FileNotFoundError:
        return "File not found"
    except Exception as e:
        return f"An error occurred: {e}"

# Example: Using else and finally
def divide(a, b):
    try:
        result = a / b
    except ZeroDivisionError:
        return "Cannot divide by zero"
    else:
        return result
    finally:
        print("Execution complete")
